import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Home from '../src/pages/Home/home';

const App = () => {
  return (
    <Router>
      <Switch>
          <Route path="/">
            <Home />
          </Route>
      </Switch>
    </Router>
  )
}

export default App;
